import React from "react";
import Card from "./Card";

const CardList = ({ bio }) => {
    const CardArray = bio.map( (user,i) => {
        return <Card
           id key={bio[i].id}
            // id={bio[i].id}
            name={bio[i].name}
            email={bio[i].email}
        />
        }
    )
    return (
        <div>
            { CardArray }
        </div>
    )
};

export default CardList;
